import React, { useState } from 'react';
import '../App.css';

function Home() {
  // ตัวอย่างข้อมูล
  const [data, setData] = useState([
    { name: 'John Doe', subject: 'Math', status: 'Completed', operator: 'Admin', level: 'Advanced' },
    { name: 'Jane Smith', subject: 'Science', status: 'In Progress', operator: 'User', level: 'Intermediate' },
    // เพิ่มข้อมูลเพิ่มเติมตามต้องการ
  ]);
   
  return (
    <div className='css-Home1'>
      <header>
        WELCOME TO ...
      </header>

      <div className='css-Home'>
        <div className='css-Home2'>
          <table className='user-table'>
            <thead>
              <tr>
                <th>ชื่อ</th>
                <th>เรื่อง</th>
                <th>สถานนะ</th>
                <th>ผู้ดำเนินการ</th>
                <th>ระดับ</th>
              </tr>
            </thead>
            <tbody>
              {data.map((item, index) => (
                <tr key={index}>
                  <td>{item.name}</td>
                  <td>{item.subject}</td>
                  <td>{item.status}</td>
                  <td>{item.operator}</td>
                  <td>{item.level}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default Home;
